// Function to convert the schedule to Telegram-compatible HTML format
function convertToTelegramHTML(text) {
  // Split the text into lines
  const lines = text.split('\n');
  let result = '<b>' + lines[0].replace(/\*\*/g, '') + '</b>\n\n';

  let inMeeting = false;

  // Process line by line
  for (let i = 1; i < lines.length; i++) {
    const line = lines[i].trim();

    // Skip empty lines
    if (!line) {
      if (inMeeting) {
        result += '\n';
        inMeeting = false;
      }
      continue;
    }

    // Handle meeting titles (numbered items)
    if (/^\d+\./.test(line)) {
      // Extract the meeting title
      const titleMatch = line.match(/^\d+\.\s+\*\*(.+?)\*\*$/);
      if (titleMatch) {
        result += '<b>' + titleMatch[1] + '</b>\n';
        inMeeting = true;
      } else {
        result += line + '\n';
      }
    }
    // Handle standalone links like [Details](url)
    else if (/^\[([^\]]+)\]\(([^)]+)\)$/.test(line)) {
      const linkMatch = line.match(/^\[([^\]]+)\]\(([^)]+)\)$/);
      if (linkMatch) {
        const linkText = linkMatch[1];
        const linkUrl = linkMatch[2];
        result += '<a href="' + linkUrl + '">' + linkText + '</a>\n';
      } else {
        result += line + '\n';
      }
    }
    // Handle meeting details (bullet points)
    else if (line.startsWith('-')) {
      // Process detail line
      let detailLine = line.replace(/^\s*-\s+/, '');

      // Extract the label and content
      const detailMatch = detailLine.match(/\*\*([^:]+):\*\*\s+(.*)/);
      if (detailMatch) {
        const label = detailMatch[1];
        let content = detailMatch[2];

        // Handle links in content
        content = content.replace(/\[([^\]]+)\]\(([^)]+)\)/g, 
          '<a href="$2">$1</a>');

        result += '<i>' + label + ':</i> ' + content + '\n';
      } else {
        // Handle standalone links in bullet points
        const linkMatch = detailLine.match(/^\[([^\]]+)\]\(([^)]+)\)$/);
        if (linkMatch) {
          const linkText = linkMatch[1];
          const linkUrl = linkMatch[2];
          result += '<a href="' + linkUrl + '">' + linkText + '</a>\n';
        } else {
          result += detailLine + '\n';
        }
      }
    }
    // Handle conclusion message
    else if (line.includes('Let me know')) {
      result += '\n' + line;
    }
    else {
      result += line + '\n';
    }
  }

  // Final cleanup of any remaining markdown
  result = result
    .replace(/\*\*/g, '')
    .replace(/\*/g, '')
    // Fix any emojis with spaces
    .replace(/ü§ñ/g, "ü§ñ ")
    .replace(/üë®‚Äçüíª/g, "üë®‚Äçüíª ");

  // One final check for any remaining markdown links that weren't caught
  result = result.replace(/\[([^\]]+)\]\(([^)]+)\)/g, '<a href="$2">$1</a>');

  return result;
}

